import React from "react";
import Colaimg from "../../../../Resources/images/sliderimages/cola.jpg";
import Barbequeimg from "../../../../Resources/images/sliderimages/barbeque.jpg";
import Kinderimg from "../../../../Resources/images/sliderimages/kinder.jpg";
import Vegetablesimg from "../../../../Resources/images/sliderimages/vegetables.jpg";
import Whiskyimg from "../../../../Resources/images/sliderimages/whisky.jpg";

import AwesomeSlider from "react-awesome-slider";
import "react-awesome-slider/dist/styles.css";
const Carouselbox = () => {
  return (
    <AwesomeSlider>
      <div data-src={Colaimg} />
      <div data-src={Barbequeimg} />
      <div data-src={Kinderimg} />
      <div data-src={Vegetablesimg} />
      <div data-src={Whiskyimg} />
    </AwesomeSlider>
  );
};

export default Carouselbox;
